// SPDX-License-Identifier: MIT 
pragma solidity ^0.8.16;

contract RegistrationContract {
    // Define a struct to store user information
    struct User {
        string userID;
        string username;
        string location;
        uint256 balanceEnergy; // DECIMAL is not supported in Solidity, use uint256 and handle decimals in the client
        uint256 balanceCoins;  // DECIMAL is not supported in Solidity, use uint256 and handle decimals in the client
        string role;
        string tokenID;        // Assuming TokenID is a unique identifier for a token, represented as a string
    }

    // Mapping to store registered users
    mapping(address => User) public users;

    // Function to register a user
    function registerUser(
        string memory _userID, 
        string memory _username, 
        string memory _location, 
        uint256 _balanceEnergy, 
        uint256 _balanceCoins, 
        string memory _role, 
        string memory _tokenID
    ) public {
        // Check if user is already registered
        require(keccak256(bytes(users[msg.sender].username)) == keccak256(""), "User already registered");

        // Register user information
        users[msg.sender] = User({
            userID: _userID,
            username: _username,
            location: _location,
            balanceEnergy: _balanceEnergy,
            balanceCoins: _balanceCoins,
            role: _role,
            tokenID: _tokenID
        });

        // Optionally: Implement payment logic here (e.g., require specific token amount)
    }

    // Function to get user data - useful for verifying user registration outside the blockchain
    function getUser(address _userAddress) public view returns (User memory) {
        return users[_userAddress];
    }
}
